import { useState } from 'react'
import { useLazyQuery } from '@apollo/client';
import React from 'react'
import { VIDEOS_SEARCH } from '../../../graphql-client/Queries';
import { useHistory } from 'react-router-dom';
import VideosSearch from '../../videosSearch/VideosSearch';
export default function Header_mid() {
  const history = useHistory();
  const [searchFilter, setSearchFilter] = useState('');
  const [executeSearch, { data }] = useLazyQuery(
    VIDEOS_SEARCH
  );
  console.log(data);
  return (
    <form className="d-flex">
            <input onChange={(e) => setSearchFilter(e.target.value)} className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button onClick={() =>
            {executeSearch({
              variables: { filter: searchFilter }
            });
            history.push(`/`);
            }

          } className="btn btn-outline-success" type="submit"><i className="fas fa-search" /></button>
          {data &&
        data.videosSearch.links.map((link, index) => (
          <Link key={VideosSearch.id} link={link} index={index} />
        ))}
    </form>
  )
}
